/* /src/component/view_content/intro */
import React from 'react';
import './viewContent.css'
import TypewriterText from '../../fx/TypewriterText';



const Intro = () => {
    return (

        <div className="view-content">
            <div className="view-title">
                <TypewriterText>Introduction:</TypewriterText>
            </div>

            <div className="view-body">
                <p><TypewriterText speed={10}>Skynet is a community driven decentralized compute platform built on top of the Antelope blockchain stack. 
                </TypewriterText></p>
                <p><TypewriterText speed={10}>
                We want to create a decentralized alternative to big-AI tools and platforms following the principles of the original cypherpunks.
                </TypewriterText></p>
                <p><TypewriterText speed={10}>
                To learn more in depth about our vision, contributors, and overall ideas, enter the link below.</TypewriterText></p>
                <br></br>

                <button className="lern-more" ><TypewriterText hover={true} ticking={true} orange={true}>/Lern_More</TypewriterText></button>
                <br></br>                

                <img src="https://avatars.githubusercontent.com/u/151031767?s=128&v=4" alt="Icon" className="navbar-icon" />       
            </div>  
        </div>
    );


};

export default Intro;
